import React from 'react'
import User  from './User'

export default class Content extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        const list = props.users
            .sort((x,y) => x.name - y.name)
            .map(user => <User user = {user}/>)
        return(
            <ul className="App-content">{list}</ul>
        )
    }
}
